import { Parallax, ParallaxLayer } from '@react-spring/parallax';
import Nbar from '../NavxFooter/NavBar';
import PresentationWeb from './Pres';
import SecSectionP from './SecSectionP';
import Foo from '../NavxFooter/Footer';
import TsectionP from './TsectionP';

const PageF1 = () => {
  return (
    <div className="bg-white dark:bg-black " style={{ margin: 0, padding: 0 }} >
      <Parallax pages={6} >
        <ParallaxLayer >
          <Nbar />
        </ParallaxLayer>
        <ParallaxLayer offset={1} speed={0.5}>
          <PresentationWeb />
        </ParallaxLayer>
        <ParallaxLayer offset={2} speed={0.5}>
          <SecSectionP />
        </ParallaxLayer>
        <ParallaxLayer offset={3} speed={0.5}>
          <TsectionP />
        </ParallaxLayer>
        <ParallaxLayer offset={4} speed={0.5} >
          <Foo />
        </ParallaxLayer>
      </Parallax>
    </div>
  );
};

export default PageF1;
